import React from "react";

export default function About() {
  return <section className="section about-section">

    <h1 className="section-title">About Us</h1>

    <p>
    Definition of beer. 1 : an alcoholic beverage usually made from malted cereal grain (such as barley), flavored with hops, and brewed by slow fermentation. 2 : a carbonated nonalcoholic or a fermented slightly alcoholic beverage with flavoring from roots or other plant parts birch beer.
    </p>

  </section>;
}
